import Header from "./component/header";
import SearchItems from "./component/header/SearchItems";
import SearchBars from "./component/header/SearchBars";
import Container from "@material-ui/core/Container";
import "./App.css";
import axios from "axios";

function App() {
  const getPostData = () => {
    axios
    .get("https://jsonplaceholder.typicode.com/users")
    .then(jsonData => console.log(jsonData.data))
    .catch(error => console.log(error));

  };
  getPostData();


  return (
    <div className="App">
      <Header />
      <SearchBars />
      <Container fixed>
        <SearchItems />
      </Container>
    </div>
  );
}

export default App;
